window.bookSummaryJSON = "<p>We were Army Rangers, the best of the best. And then one day, everything that we worked so hard to become was ripped away.</p> <p>Now, we're in some podunk town, trying to find a sense of normal among the crazy, and learn how to live again. That gets a hell of a lot harder to do when a virus spreads mercilessly across the country, killing 85 percent of the people who contract it.</p> <p>In the midst of the panic, we're tasked with one last rescue mission. It's just our luck that the fool we're rescuing doesn't believe that the world as we know it is actually ending.</p> <p>Looks like the apocalypse is about to get real interesting.</p> <p>Contains mature themes.</p>"; 
